    data: |
      SELECT DISTINCT + col0 * + - 95 * - + col0 - + + col1 + col0 + 17 + - + col2 + + 38 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT - col0 * + col2 NOT BETWEEN 18 AND + + col2;
  - name: tab2

outputs:
  - name: q8026.out
    data: |
